import React from "react";
import {Header} from '../components/Header/Header.jsx';
import DashboardBox from "../components/Dashboard/DashboardBox.jsx";
import Photo from "../components/Assets/smkn3mks.png";
import '../styles/Dashboard.css'
import Teacher from '../components/Assets/teacher.png';
import Student from '../components/Assets/student.png';
import Headmaster from '../components/Assets/headmaster.png';
import File from '../components/Assets/files.png';
import Wakasek from '../components/Assets/wakasek.png'
import { Link } from "react-router-dom";

export const Dashboard = () => {
    return(
    <body>
    <div class="dashboard-wrapper">
    <Header/>
    </div>
    <img className="school-pict"src={Photo}/>
    <div className="content-wrapper">
    <tr>
        <th><Link to="/data-guru"><DashboardBox className="box-menu" Text="Data Guru" src={Teacher} imageSize="60px"/></Link></th>
        <th><Link to="/data-siswa"><DashboardBox className="box-menu" Text="Data Siswa" src={Student} imageSize="60px"/></Link></th>
        <th><Link to="/data-kepala-sekolah"><DashboardBox className="box-menu" Text="Data Kepala Sekolah " src={Headmaster} imageSize="80px"/></Link></th>
    </tr>
    <tr>
        <th><DashboardBox className="box-menu" Text="Data Wakasek Kurikulum" src={Wakasek} imageSize="60px"/></th>
        <th><DashboardBox className="box-menu" Text="Rekapitulasi Absen" src={File} imageSize="60px"/></th>
    </tr>
    </div>
    </body>
   
);


}

export default Dashboard;
